  `PASSWORD` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '密码',
  `TYPE` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '0-试用 1-正式',
  `STATUS` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '组织状态\n            ’0‘--启用 \n            ’1‘--禁用 \n            ’2’--锁定 \n            ‘3’--删除',
  `OPEN_DAY` date NULL DEFAULT NULL COMMENT '启用时间',
  `END_DAY` date NULL DEFAULT NULL COMMENT '到期时间',
  `FILE_SPACE` decimal(9, 0) NULL DEFAULT NULL COMMENT '文件空间(m)',
  `USED_SPACE` decimal(9, 0) NULL DEFAULT NULL COMMENT '已用空间',
  `BALANCE` decimal(10, 2) NULL DEFAULT NULL COMMENT '账户余额',
  `SMS_BALANCE` decimal(10, 2) NULL DEFAULT NULL COMMENT '短信费用',
  `LOGO` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '租户LOGO',
