DROP TABLE IF EXISTS `tty_sys_message`;
CREATE TABLE `tty_sys_message`  (
  `ID` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `SRC` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '来源标识',
  `DEST` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '目的标识',
  `QUEUE` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '队列名称',
  `EXCHANGE` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '交换机名称',
  `ROUTINGKEY` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '路由键标识',
  `CREATEDATE` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `CONTENT` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '消息内容',
  `EXT_DATE1` datetime(0) NULL DEFAULT NULL COMMENT '预留时间字段1',
  `EXT_DATE2` datetime(0) NULL DEFAULT NULL COMMENT '预留时间字段2',
  `EXT_NUM1` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段1',
  `EXT_NUM2` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段2',
  `EXT_NUM3` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段3',
  `EXT_STR1` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段1',
