DROP TABLE IF EXISTS `tty_sys_run_log`;
CREATE TABLE `tty_sys_run_log`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `timer_task_id` bigint(20) NULL DEFAULT NULL COMMENT '任务ID',
  `group_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '任务组',
  `start_at` datetime(0) NOT NULL COMMENT '执行开始时间',
  `end_at` datetime(0) NOT NULL COMMENT '执行结束时间',
  `job_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '数据',
  `EXT_DATE1` datetime(0) NULL DEFAULT NULL COMMENT '预留时间字段1',
  `EXT_DATE2` datetime(0) NULL DEFAULT NULL COMMENT '预留时间字段2',
  `EXT_NUM1` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段1',
  `EXT_NUM2` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段2',
  `EXT_NUM3` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段3',
  `EXT_STR1` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段1',
  `EXT_STR2` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段2',
  `EXT_STR3` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段3',
  `EXT_STR4` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段4',
  `EXT_STR5` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段5',
  `DELETE_FLAG` int(11) NULL DEFAULT 0 COMMENT '删除标记[0-未删除 1-删除]',
  `CREATE_USER` bigint(20) NULL DEFAULT NULL COMMENT '创建人ID',
  `CREATE_USER_DEPT` bigint(20) NULL DEFAULT NULL COMMENT '创建人所在部门ID',
  `CREATE_USER_ORG` bigint(20) NULL DEFAULT NULL COMMENT '创建人所在单位ID',
  `CREATE_DATE` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `MODIFY_USER` bigint(20) NULL DEFAULT NULL COMMENT '修改人ID',
  `MODIFY_DATE` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 45 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

