  `EXT_STR3` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `EXT_STR4` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `EXT_STR5` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `WEIGHT` int(11) NULL DEFAULT NULL,
  `SECRET` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

DROP TABLE IF EXISTS `tty_sys_setting`;
CREATE TABLE `tty_sys_setting`  (
  `ID` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `setting_key` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统参数key',
  `setting_value` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统参数value',
  `setting_comment` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统参数名称描述',
  `setting_input_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统参数输入框类型 radio 或 text',
  `setting_input_size` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统参数输入最大长度',
  `setting_input_default` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统参数输入框默认值 例如1&男，2&女 或 99',
  `SETTING_INPUT_REMARK` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `setting_input_validate` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统参数输入框验证 例如isMsgService:{required:false,maxlength:1},msgPrefix:{required:false,maxlength:20}',
  `setting_input_queue` int(11) NULL DEFAULT NULL COMMENT '系统参数输入框排序',
  `DELETE_FLAG` int(11) NULL DEFAULT NULL COMMENT '删除标记\n            1 删除\n            0 未删除',
  `CREATE_USER_ORG` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人所在单位id',
  `CREATE_USER_DEPT` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人所在部门id',
  `CREATE_USER` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人员ID',
  `CREATE_DATE` datetime(0) NOT NULL COMMENT '创建时间',
  `MODIFY_USER` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人ID',
  `MODIFY_DATE` datetime(0) NOT NULL COMMENT '修改时间',
  `EXT_DATE1` datetime(0) NULL DEFAULT NULL COMMENT '预留时间字段1',
  `EXT_DATE2` datetime(0) NULL DEFAULT NULL COMMENT '预留时间字段2',
  `EXT_NUM1` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段1',
  `EXT_NUM2` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段2',
  `EXT_NUM3` decimal(16, 2) NULL DEFAULT NULL COMMENT '预留数字字段3',
  `EXT_STR1` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段1',
  `EXT_STR2` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段2',
  `EXT_STR3` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段3',
  `EXT_STR4` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段4',
  `EXT_STR5` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字符字段5',
  `WEIGHT` int(11) NULL DEFAULT NULL,
  `SECRET` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统设置表' ROW_FORMAT = Dynamic;
