  `SUBSYSTEMID` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `MENUID` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `DELETE_FLAG` int(11) NOT NULL DEFAULT 0 COMMENT '删除标记\n            1 删除\n            0 未删除',
  `QUEUE` int(11) NOT NULL COMMENT '排序',
  `CREATE_USER` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人员ID',
