DROP VIEW IF EXISTS `vw_user_menu`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `vw_user_menu` AS select `m`.`MENU_ID` AS `MENU_ID`,`r`.`ROLE_ID` AS `role_id`,`r`.`USER_ID` AS `user_id` from (`tty_sys_role_menu` `m` join `tty_sys_user_role` `r`) where (`m`.`ROLE_ID` = `r`.`ROLE_ID`);

DROP VIEW IF EXISTS `workflow_history_group`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `workflow_history_group` AS select max(`t`.`submit_type`) AS `submit_type`,`t`.`instance_id` AS `instance_id` from `workflow_extend_history` `t` group by `t`.`instance_id`;

DROP VIEW IF EXISTS `workflow_done_bak`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `workflow_done_bak` AS select distinct `t1`.`ID_` AS `TASK_ID`,`t1`.`PROC_INST_ID_` AS `proc_inst_id`,`t1`.`EXECUTION_ID_` AS `EXECUTION_ID`,`t1`.`TASK_DEF_KEY_` AS `act_id`,`t6`.`name` AS `act_name`,(case when isnull(`t1`.`ASSIGNEE_`) then `t4`.`USER_ID_` else `t1`.`ASSIGNEE_` end) AS `ASSIGNEE`,`t4`.`USER_ID_` AS `condidate`,`t2`.`PROC_DEF_ID_` AS `definitionId_`,`t2`.`BUSINESS_KEY_` AS `business_key_`,`t1`.`START_TIME_` AS `start_time_`,`t3`.`submit_type` AS `submit_type`,(case when (`t5`.`submit_type` = '7') then 'STOP' when isnull(`t2`.`END_TIME_`) then 'SUBMIT' else 'END' end) AS `flowStatus`,(case when ((`t8`.`submit_type` = 2) and ((`t8`.`targetUserId` = '') or isnull(`t8`.`targetUserId`))) then 'END' when (`t8`.`submit_type` = 2) then 'SUBMIT' when (`t8`.`submit_type` = 3) then 'REJECT' when (`t8`.`submit_type` = 4) then 'GETBACK' when (`t8`.`submit_type` = 5) then 'MOVE' when (`t8`.`submit_type` = 6) then 'GOTO' when (`t8`.`submit_type` = 7) then 'STOP' when (`t8`.`submit_type` = 8) then 'SUSPEND' when (`t8`.`submit_type` = 9) then 'RESUME' else '' end) AS `flowTrueStatus`,`t8`.`user_id` AS `flowTrueUser` from (((((((`act_hi_taskinst` `t1` left join `act_hi_procinst` `t2` on((`t1`.`PROC_INST_ID_` = `t2`.`PROC_INST_ID_`))) left join `act_hi_identitylink` `t4` on(((`t1`.`ID_` = `t4`.`TASK_ID_`) and (`t4`.`TASK_ID_` is not null) and (`t4`.`TYPE_` = 'candidate')))) left join `workflow_extend_rutask` `t3` on((((`t1`.`ID_` = `t3`.`task_id`) and (`t3`.`submit_type` = 4)) or (`t3`.`submit_type` = 7)))) left join `workflow_history_group` `t5` on((`t1`.`PROC_INST_ID_` = `t5`.`instance_id`))) left join `workflow_deploy_node` `t6` on(((`t1`.`PROC_DEF_ID_` = `t6`.`definition_id`) and (`t1`.`TASK_DEF_KEY_` = `t6`.`component_id`)))) left join `workflow_extend_taskdelegate` `t7` on(((`t1`.`ID_` = `t7`.`task_id`) and (`t7`.`assignee_id` = (case when isnull(`t1`.`ASSIGNEE_`) then `t4`.`USER_ID_` else `t1`.`ASSIGNEE_` end))))) left join `workflow_extend_history` `t8` on(((`t8`.`submit_type` in (2,3,4,6,7)) and (`t8`.`parent_task_id` = `t1`.`ID_`) and ((`t8`.`user_id` = (case when isnull(`t1`.`ASSIGNEE_`) then `t4`.`USER_ID_` else `t1`.`ASSIGNEE_` end)) or (`t8`.`user_id` = `t7`.`assignor_id`) or (`t8`.`submit_type` = 4))))) where ((`t1`.`END_TIME_` is not null) and (`t2`.`BUSINESS_KEY_` is not null));

DROP VIEW IF EXISTS `workflow_instance_bak`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `workflow_instance_bak` AS select `t1`.`NAME_` AS `workflowTitle_`,`t1`.`PROC_DEF_ID_` AS `definitionId_`,`t1`.`BUSINESS_KEY_` AS `business_key_`,`t1`.`START_USER_ID_` AS `create_user`,`t1`.`PROC_INST_ID_` AS `proc_inst_id`,`t1`.`END_ACT_ID_` AS `endNodeId`,`t1`.`START_TIME_` AS `CREATE_TIME`,`t3`.`submit_type` AS `submit_type`,(case when (`t3`.`submit_type` = 3) then 'REJECT' when ((max(`t4`.`submit_type`) > 1) and isnull(max(`t1`.`END_TIME_`))) then 'SUBMIT' else (case when (`t3`.`submit_type` = 0) then 'SAVE' when isnull(`t1`.`END_TIME_`) then 'SUBMIT' else 'END' end) end) AS `flowStatus`,(case when (max(`t4`.`submit_type`) > 1) then '' else min((case when (`t3`.`submit_type` = 0) then `t2`.`ID_` else '' end)) end) AS `TASK_ID`,(case when isnull(`t2`.`TASK_DEF_KEY_`) then `t1`.`END_ACT_ID_` when (max(`t4`.`submit_type`) > 1) then `t2`.`TASK_DEF_KEY_` else min((case when (`t3`.`submit_type` = 0) then `t2`.`TASK_DEF_KEY_` else `t1`.`END_ACT_ID_` end)) end) AS `ACT_ID`,(case when (max(`t4`.`submit_type`) = 7) then 'STOP' when (`t7`.`submit_type` = 1) then 'SAVE' when (`t7`.`submit_type` = 2) then 'SUBMIT' when (`t7`.`submit_type` = 3) then 'REJECT' when (`t7`.`submit_type` = 4) then 'GETBACK' when (`t7`.`submit_type` = 5) then 'MOVE' when (`t7`.`submit_type` = 6) then 'GOTO' when (`t7`.`submit_type` = 7) then 'STOP' when (`t7`.`submit_type` = 8) then 'SUSPEND' when (`t7`.`submit_type` = 9) then 'RESUME' else 'END' end) AS `flowTrueStatus` from ((((((`act_hi_procinst` `t1` left join `act_ru_task` `t2` on((`t1`.`PROC_INST_ID_` = `t2`.`PROC_INST_ID_`))) left join `workflow_extend_rutask` `t3` on((`t2`.`ID_` = `t3`.`task_id`))) left join `workflow_extend_history` `t4` on((`t1`.`PROC_INST_ID_` = `t4`.`instance_id`))) left join `act_ru_identitylink` `t5` on(((`t2`.`ID_` = `t5`.`TASK_ID_`) and (`t5`.`TASK_ID_` is not null) and (`t5`.`TYPE_` = 'candidate')))) left join `workflow_extend_taskdelegate` `t6` on(((`t2`.`ID_` = `t6`.`task_id`) and (`t6`.`assignee_id` = (case when isnull(`t2`.`ASSIGNEE_`) then `t5`.`USER_ID_` else `t2`.`ASSIGNEE_` end))))) left join `workflow_extend_history` `t7` on(((`t7`.`submit_type` > 0) and (`t7`.`targetUserId` like concat('%',`t6`.`assignor_id`,'%')) and ((`t7`.`task_id` like concat('%',`t2`.`ID_`,'%')) or ((`t7`.`parent_task_id` = `t2`.`ID_`) and (`t7`.`submit_type` = '5')))))) group by `t1`.`PROC_INST_ID_`;

DROP VIEW IF EXISTS `workflow_todo_taskuser`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `workflow_todo_taskuser` AS select `t`.`instance_id` AS `instance_id`,(case when (`t`.`submit_type` = '5') then `t`.`parent_task_id` else `t`.`task_id` end) AS `taskid`,(case when (locate('5',convert(group_concat(distinct `t`.`submit_type` separator ',') using utf8mb4)) > 0) then '5' else convert(group_concat(distinct `t`.`submit_type` separator ',') using utf8mb4) end) AS `submit_type`,`t`.`targetUserId` AS `targetUserId` from `workflow_extend_history` `t` group by `t`.`instance_id`,(case when (`t`.`submit_type` = '5') then `t`.`parent_task_id` else `t`.`task_id` end),`t`.`targetUserId`;

DROP VIEW IF EXISTS `workflow_todo_bak`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `workflow_todo_bak` AS select `t1`.`ID_` AS `TASK_ID`,`t3`.`NAME_` AS `workflowTitle_`,`t1`.`PROC_INST_ID_` AS `PROC_INST_ID`,`t1`.`EXECUTION_ID_` AS `EXECUTION_ID`,`t1`.`TASK_DEF_KEY_` AS `ACT_ID`,`t5`.`name` AS `ACT_NAME`,(case when isnull(`t1`.`ASSIGNEE_`) then `t2`.`USER_ID_` else `t1`.`ASSIGNEE_` end) AS `ASSIGNEE`,`t1`.`DELEGATION_` AS `DELEGATION_ID`,`t1`.`DESCRIPTION_` AS `DESCRIPTION`,`t1`.`CREATE_TIME_` AS `CREATE_TIME`,`t2`.`USER_ID_` AS `condidate`,`t3`.`BUSINESS_KEY_` AS `business_key_`,`t1`.`PROC_DEF_KEY_` AS `definitionKey_`,`t3`.`PROC_DEF_ID_` AS `definitionId_`,(case when (`t1`.`SUSPENSION_STATE_` = 2) then 'SUSPEND' when (`t4`.`submit_type` = 3) then 'REJECT' when (`t4`.`submit_type` = 0) then 'SAVE' when isnull(`t3`.`END_TIME_`) then 'SUBMIT' else 'END' end) AS `flowStatus`,(case when (`t1`.`SUSPENSION_STATE_` = 2) then 'SUSPEND' when (`t8`.`submit_type` = 1) then 'SAVE' when (`t8`.`submit_type` = 2) then 'SUBMIT' when (`t8`.`submit_type` = 3) then 'REJECT' when (`t8`.`submit_type` = 4) then 'GETBACK' when (`t8`.`submit_type` = 5) then 'MOVE' when (`t8`.`submit_type` = 6) then 'GOTO' when (`t8`.`submit_type` = 7) then 'STOP' when (`t8`.`submit_type` = 8) then 'SUSPEND' when (`t8`.`submit_type` = 9) then 'RESUME' else 'END' end) AS `flowTrueStatus`,`t7`.`assignor_id` AS `ASSIGNOR` from (((((((`act_ru_task` `t1` left join `act_ru_identitylink` `t2` on(((`t1`.`ID_` = `t2`.`TASK_ID_`) and (`t2`.`TASK_ID_` is not null) and (`t2`.`TYPE_` = 'candidate')))) left join `act_hi_procinst` `t3` on(((`t1`.`PROC_INST_ID_` = `t3`.`PROC_INST_ID_`) and (`t3`.`BUSINESS_KEY_` is not null)))) left join `workflow_extend_rutask` `t4` on((`t1`.`ID_` = `t4`.`task_id`))) left join `workflow_deploy_node` `t5` on(((`t1`.`PROC_DEF_ID_` = `t5`.`definition_id`) and (`t1`.`TASK_DEF_KEY_` = `t5`.`component_id`)))) left join `workflow_history_group` `t6` on((`t1`.`PROC_INST_ID_` = `t6`.`instance_id`))) left join `workflow_extend_taskdelegate` `t7` on(((`t1`.`ID_` = `t7`.`task_id`) and (`t7`.`assignee_id` = (case when isnull(`t1`.`ASSIGNEE_`) then `t2`.`USER_ID_` else `t1`.`ASSIGNEE_` end))))) left join `workflow_todo_taskuser` `t8` on(((`t8`.`submit_type` > 0) and (`t8`.`targetUserId` like concat('%',`t7`.`assignor_id`,'%')) and (`t8`.`taskid` like concat('%',`t1`.`ID_`,'%')))));

DROP FUNCTION IF EXISTS `F_DEPARTMENT_FINDCHILDLIST`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `F_DEPARTMENT_FINDCHILDLIST`(deptId VARCHAR(32)) RETURNS varchar(5000) CHARSET utf8
    DETERMINISTIC
BEGIN
    DECLARE pTemp VARCHAR(5000);
    DECLARE cTemp VARCHAR(5000);
    SET pTemp = '';
    SET cTemp = CAST(deptId AS CHAR);
    WHILE cTemp IS NOT NULL DO
      SET pTemp = CONCAT(pTemp,',',cTemp);
      SELECT GROUP_CONCAT(id) INTO cTemp FROM tty_sys_department
      WHERE FIND_IN_SET(parent_id,cTemp)>0;
    END WHILE;
    RETURN SUBSTRING(pTemp,2);
  END
;;
delimiter ;

DROP FUNCTION IF EXISTS `F_GET_DEPT_CHILDREN`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `F_GET_DEPT_CHILDREN`(deptId VARCHAR(32)) RETURNS varchar(5000) CHARSET utf8
    DETERMINISTIC
BEGIN
    DECLARE pTemp VARCHAR(5000);
    DECLARE cTemp VARCHAR(5000);
    SET pTemp = '';
    SET cTemp = CAST(deptId AS CHAR);
    WHILE cTemp IS NOT NULL DO
      SET pTemp = CONCAT(pTemp,',',cTemp);
      SELECT GROUP_CONCAT(id) INTO cTemp FROM tty_sys_department
      WHERE FIND_IN_SET(parent_id,cTemp)>0 and dept_type != '1' ;
    END WHILE;
    return substring(pTemp,length(deptId)+3);
  END
;;
delimiter ;

DROP FUNCTION IF EXISTS `F_GET_DEPT_PARENT`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `F_GET_DEPT_PARENT`(nodeId VARCHAR(32)) RETURNS varchar(5000) CHARSET utf8
    DETERMINISTIC
BEGIN
    DECLARE sParentList VARCHAR (5000) ;
    DECLARE sParentTemp VARCHAR (5000) ;
    SET sParentTemp = CAST(nodeId AS CHAR) ;
    WHILE
    sParentTemp IS NOT NULL DO
      IF (sParentList IS NOT NULL)
      THEN SET sParentList = CONCAT(sParentTemp, ',', sParentList) ;
      ELSE SET sParentList = CONCAT(sParentTemp) ;
      END IF ;
      SELECT
        GROUP_CONCAT(parent_id) INTO sParentTemp
      FROM
        tty_sys_department  WHERE parent_id != 0
                                  and FIND_IN_SET(id, sParentTemp) > 0 ;
    END WHILE ;
    RETURN SUBSTRING(sParentList,3);
  END
;;
delimiter ;

DROP FUNCTION IF EXISTS `F_GET_DEPT_TREE`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `F_GET_DEPT_TREE`(deptId VARCHAR(32)) RETURNS varchar(5000) CHARSET utf8
    DETERMINISTIC
BEGIN
