      WHERE FIND_IN_SET(parent_id,cTemp)>0 AND dept_type != '1' ;
    END WHILE;
    RETURN SUBSTRING(pTemp,2);
  END
;;
delimiter ;

DROP FUNCTION IF EXISTS `F_GET_ORG`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `F_GET_ORG`(nodeId VARCHAR(32)) RETURNS varchar(5000) CHARSET utf8
    DETERMINISTIC
BEGIN
    DECLARE sParentList VARCHAR (5000) ;
    DECLARE sParentTemp VARCHAR (5000) ;
    SET sParentTemp = CAST(nodeId AS CHAR) ;
    WHILE
    sParentTemp IS NOT NULL DO
      IF (sParentList IS NOT NULL)
      THEN SET sParentList = CONCAT(sParentTemp, ',', sParentList) ;
      ELSE SET sParentList = CONCAT(sParentTemp) ;
      END IF ;
      SELECT
        GROUP_CONCAT(parent_id) INTO sParentTemp
      FROM
        tty_sys_department  WHERE parent_id != 0
                                  AND FIND_IN_SET(id, sParentTemp) > 0 ;
    END WHILE ;
    RETURN SUBSTRING(sParentList,3);
  END
;;
delimiter ;

DROP FUNCTION IF EXISTS `F_SUBDEPARTMENT_FINDCHILDLIST`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `F_SUBDEPARTMENT_FINDCHILDLIST`(deptId VARCHAR(32)) RETURNS varchar(5000) CHARSET utf8
    DETERMINISTIC
BEGIN
	DECLARE pTemp VARCHAR(5000);
	DECLARE cTemp VARCHAR(5000);
	SET pTemp = '';
	SET cTemp = CAST(deptId AS CHAR);
	WHILE cTemp IS NOT NULL DO
		SET pTemp = CONCAT(pTemp,',',cTemp);
		SELECT GROUP_CONCAT(id) INTO cTemp FROM tty_sys_sub_department
		WHERE FIND_IN_SET(parent_id,cTemp)>0;
	END WHILE;
	RETURN SUBSTRING(pTemp,2);
    END
;;
delimiter ;

